import React from "react";

function Card(props) {
  return(
<>
    <div className="cards">
<div className="card">
<img src={props.imgs} className="img2" /> 
<div className="card_info" >
  <span className="card_category"></span>
  <h3 className="card_titl" ></h3>
  <a href=" " target="blank">
  <button>WATCH NOW</button>
  </a>

  </div>
  </div>
</div>
</>

  
  );
  }






export default Card ;
